
# 从桌面的log日志文件中获取单车type为2的内容，并将结果保存桌面

import datetime
import json
import os

import openpyxl

addTime = 'addTime'
latitude = 'latitude'
longitude = 'longitude'


def save(batteryList: list):
    wb = openpyxl.Workbook()
    sheet = wb.active
    sheet.title = "轨迹"
    sheet.cell(row=1, column=1, value='时间')
    sheet.cell(row=1, column=3, value='经纬度')

    for row in range(0, len(batteryList)):
        dispatcher = batteryList[row][addTime]
        dateTimeP = datetime.datetime.strptime(dispatcher, '%Y-%m-%dT%H:%M:%S.%fZ')
        chinaTime = (dateTimeP + datetime.timedelta(hours=8)).strftime('%Y-%m-%d %H:%M:%S')
        sheet.cell(row=row + 2, column=1, value=chinaTime)

        number = str(batteryList[row][longitude]) + "," + str(batteryList[row][latitude])
        sheet.cell(row=row + 2, column=2, value=number)

    desk_top = os.path.join(os.path.expanduser("~"), 'Desktop')
    target_dir = os.path.abspath(desk_top)
    file_path = os.path.join(target_dir, "轨迹时间和经纬度.xlsx")
    wb.save(file_path)


def fetchTimeLocation(content: str) -> list:
    model = json.loads(content)
    try:
        hits = model["hits"]["hits"]
        sourceList = list()

        for hit in hits:
            result = dict()
            source = hit["_source"]
            result[addTime] = source[addTime]
            result[latitude] = source[latitude]
            result[longitude] = source[longitude]

            sourceList.append(result)

        return sourceList

    except Exception as e:
        print(e)
        return None


